// src/components/admin/AdminDashboard.jsx

import React from "react";
import { useNavigate } from "react-router-dom";
import "./AdminDashboard.css"; // Optional styling

const AdminDashboard = () => {
  const navigate = useNavigate();

  return (
    <div className="admin-dashboard">
      <h1>Admin Dashboard</h1>
      <div className="dashboard-cards">
        <button onClick={() => navigate("/admin/manage-users")}>Manage Users</button>
        <button onClick={() => navigate("/admin/productivity")}>Monitor Productivity</button>
        <button onClick={() => navigate("/admin/task-rules")}>Modify Task Rules</button>
        <button onClick={() => navigate("/admin/reports")}>Generate Reports</button>
        <button onClick={() => navigate("/admin/model-config")}>Configure AI Model</button>
      </div>
    </div>
  );
};

export default AdminDashboard;
